import styled from 'styled-components'
import axios from 'axios'
import { useCookies } from 'react-cookie'
import { useNavigate } from 'react-router-dom'

type propsType = {
  memberId: string;
  password: string;
}

export default function LogIn({ memberId, password }: propsType) {

  const navigate = useNavigate();

  const doLogin = async (e: React.MouseEvent<HTMLButtonElement>) => {
    e.preventDefault();
    try {
      await axios
        .post(
          'http://localhost:5000/api/login',
          {
            memberId: memberId,
            password: password,
          }
        )
        .then((res) => {
          console.log(res.data)
          if (res.status === 200) {
            // navigate('../');
        }})
      } catch (error) {
        console.log(error);
      }
  }


  return (
    <LogInButton onClick={doLogin}>
      <Span>로그인</Span>
    </LogInButton>
  )
}

const LogInButton = styled.button`
  display: block;
  padding: 0px 10px;
  text-align: center;
  overflow: hidden;
  width: 100%;
  height: 54px;
  border-radius: 3px;
  color: rgb(255, 255, 255);
  background-color: rgb(95, 0, 128);
  border: 0px none;
`

const Span = styled.span`
  display: inline-block;
  font-size: 16px;
  font-weight: 500;
`
